import React, { useState, useEffect } from 'react';


const UserManagement = () => {
  const [users, setUsers] = useState([]);
  const [selectedUser, setSelectedUser] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  useEffect(() => {
    fetchUsers();
  }, []);

  const fetchUsers = () => {
    setLoading(true);
    userService.getAllUsers()
      .then(data => {
        setUsers(data);
        setLoading(false);
      })
      .catch(err => {
        setError(err.message);
        setLoading(false);
      });
  };

  const handleSelectUser = (user) => {
    setSelectedUser(user);
  };

  const handleDeleteUser = (userId) => {
    userService.deleteUser(userId)
      .then(() => {
        fetchUsers(); // Обновляем список пользователей после удаления
      })
      .catch(err => {
        console.error(err);
        alert('Ошибка при удалении пользователя');
      });
  };

  const handleSubmit = (user) => {
    const action = user.id ? userService.updateUser : userService.addUser;
    action(user)
      .then(() => {
        fetchUsers(); // Обновляем список пользователей после добавления/редактирования
        setSelectedUser(null); // Очищаем выбранного пользователя
      })
      .catch(err => {
        console.error(err);
        alert('Ошибка при обновлении пользователя');
      });
  };

  return (
    <div>
      <h2>Управление пользователями</h2>
      {loading ? <p>Загрузка...</p> : error ? <p>Ошибка: {error}</p> : (
        <>
          <UserForm user={selectedUser} onSubmit={handleSubmit} />
          <table>
            <thead>
              <tr>
                <th>ID</th>
                <th>Имя</th>
                <th>Действия</th>
              </tr>
            </thead>
            <tbody>
              {users.map(user => (
                <tr key={user.id}>
                  <td>{user.id}</td>
                  <td>{user.name}</td>
                  <td>
                    <button onClick={() => handleSelectUser(user)}>Редактировать</button>
                    <button onClick={() => handleDeleteUser(user.id)}>Удалить</button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </>
      )}
    </div>
  );
};

// Компонент формы для добавления и редактирования пользователей
const UserForm = ({ user, onSubmit }) => {
  const [formData, setFormData] = useState({
    id: user?.id || '',
    name: user?.name || '',
    // Другие поля пользователя
  });

  useEffect(() => {
    if (user) {
      setFormData({
        id: user.id,
        name: user.name,
        // Обновляем форму при смене выбранного пользователя
      });
    }
  }, [user]);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prevFormData => ({
      ...prevFormData,
      [name]: value
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    onSubmit(formData);
  };

  return (
    <form onSubmit={handleSubmit}>
      <input
        type="text"
        name="name"
        value={formData.name}
        onChange={handleChange}
        placeholder="Имя пользователя"
      />
      {/* Другие поля ввода */}
      <button type="submit">Сохранить</button>
    </form>
  );
};

export default UserManagement;
